import React from 'react';
import ExposurePlus1TwoToneIcon from '@material-ui/icons/ExposurePlus1TwoTone';
import ExposureNeg1TwoToneIcon from '@material-ui/icons/ExposureNeg1TwoTone';

const WordResults = ({ words }) => {
	let wordList = [];
	if (words.data) {
		wordList = words.data.map(each => {
			return (
				<span key={each.id}>
					{each.word} {'  '}
					{'  '}
					{/* {ExposureNeg1TwoToneIcon} */}
					{'  '}
				</span>
			);
		});
	}

	return (
		<div>
			{words.data ? (
				words.data.length ? (
					<div>
						{/* {words.data.map(each => {
							return (
								<span key={each.id}>
									{each.word} {'  '}
									{ExposurePlus1TwoToneIcon} {'  '} {ExposureNeg1TwoToneIcon}
									{'  '}
								</span>
							);
						})} */}
						{wordList}
					</div>
				) : (
					<p>Nothing found!!!</p>
				)
			) : (
				<p>Loading...</p>
			)}
			{ExposureNeg1TwoToneIcon}
		</div>
	);
};

export default WordResults;
